      top_edge = i // C == 0
      right_edge = (i+1) % C == 0
      bottom_edge = i // C == R-1

      if not left_edge:
          res.append(i-1)
          if not top_edge:
              res.append(i-1-C)
          if not bottom_edge:
              res.append(i+C-1)

      if not right_edge:
