      for x in xrange(columns):
          for y in xrange(rows):
              cells = [["?" for i in xrange(columns)] for j in xrange(rows)]
              cells[y][x] = "c"
              solution = try_to_click(x, y, cells, rows * columns - mines - 1)

              if solution:
                  return "
".join(["".join(row) for row in solution]).replace("?", "*")

      return "Impossible"


