  @memoizeit
  def is_stage_solvable(rows, cols, mines):
      """Return True iff stage is solvable. 
      Also return fill instruction:
      0 if impossible/dontcare, 1 to fill row, 2 to fill column, 
      3 for row special (most in the row), 4 for col special (most in the col)
      """
      rc = rows * cols

      if mines == rc:
          return False, 0

      if rows == 1:
          return mines <= rc - 1, 2
      if cols == 1:
          return mines <= rc - 1, 1

      if mines == rc - 1:
          return True, 1  # doesn't matter what to fill

      if mines > rc - 4:
          return False, 0

      if rows == 2:
          return (False, 0) if mines == 1 else (True, 2)
      if cols == 2:
          return (False, 0) if mines == 1 else (True, 1)

      if rows <= cols:
          if mines >= rows:
              return True, 2
          if mines == rows - 1:
              if mines == cols - 1:
                  if rows == 3:
                      return False, 0
                  return True, 4 # L shape fill, most in the column
              else:
                  return True, 1 # fill row
          return True, 2 
      else:
          if mines >= cols:
              return True, 1
          if mines == cols - 1:
              if mines == rows - 1:
                  if cols == 3:
                      return False, 0
                  return True, 3 # L shape fill, most in the row
              else:
                  return True, 2 # fill column
          return True, 1 

  @timeit
  def solveit(case):
      rows = case["R"]
      cols = case["C"]
      mines = case["M"]

      b = Board(rows, cols)
      r, c, m = rows, cols, mines

      while m >= 0:
          okgo, howtofill = is_stage_solvable(r, c, m)
          if not okgo:
              return "Impossible"
          if howtofill == 1: # fill row
              b.fill_edge_row(m)
              if m <= c:
                  break # fill and done
              m -= c
              r -= 1
          elif howtofill == 2: # fill column
              b.fill_edge_col(m)
              if m <= r:
                  break # fill and done
              m -= r
              c -= 1
          elif howtofill == 3: # L shape fill, most in the row
              b.fill_edge_row(m - 1)
              b.fill_edge_col(1)
              break # fill and done
          elif howtofill == 4: # L shape fill, most in the column
              b.fill_edge_col(m - 1)
              b.fill_edge_row(1)
              break # fill and done
          else:
              assert False

      return str(b) 



